@Component({
  templateUrl: './update-site.html',
  styleUrls: ['./merchant-details.component.css']
})
export class SiteDetailComponent {

  static index: number;
  static acceptorPoints = [];
  static qrImage: string | ArrayBuffer;
  static requestData;

  get accPoints() {
    return SiteDetailComponent.acceptorPoints;
  }

  constructor(private gipService: GipService, private modalService: NgbModal, public activeModal: NgbActiveModal) { }

  modal(index: number = -1) {
    UpdateAcceptorPointDetails.index = index;
    this.modalService.open(UpdateAcceptorPointDetails, { backdrop: 'static', keyboard: false }).result.then(
      (newRow) => {
        if (index == -1) {
          SiteDetailComponent.acceptorPoints.push(newRow);
        }
        else {
          SiteDetailComponent.acceptorPoints.splice(index, 1, newRow);
        }
      },
      () => {

      });
    $('#acceptorpointcompanyname').val($('#companyname').val());
    $('#acceptorpointdescription').val($('#sitelocation').val());
    if (index > -1) {
      $('#acceptorpointid').val(SiteDetailComponent.acceptorPoints[index].id);
      $('#acceptorpoint').val(SiteDetailComponent.acceptorPoints[index].name);
      $('#acceptorpointacronym').val(SiteDetailComponent.acceptorPoints[index].acronym);
      $('#acceptorpointmobilenumber').val(SiteDetailComponent.acceptorPoints[index].mobileNumber);
    }
  }

  updatingMerchantSite: boolean = false;
  updateSiteSuccess: boolean = false;
  updateSiteFailed: boolean = false;
  save() {
    let newRow = {
      "id": $('#siteid').val(),
      "location": $('#sitelocation').val(),
      "typeOfSite": $('#sitetypeofsite').val(),
      "openingDate": $('#siteopeningdate').val(),
      "country": $('#sitecountry').val(),
      "region": $('#siteregion').val(),
      "city": $('#sitecity').val(),
      "physicalAddress1": $('#sitephysicaladdress1').val(),
      "physicalAddress2": $('#sitephysicaladdress2').val(),
      "physicalAddress3": $('#sitephysicaladdress3').val(),
      "digitalAddress": $('#sitedigitaladdress').val(),
      "email": $('#siteemail').val(),
      "mobileNumber": $('#sitemobilenumber').val(),
      "acceptorPoints": SiteDetailComponent.acceptorPoints,
      "name": $('#sitename').val(),
      "status": $('#sitestatus').val()
    };

    var m: Merchant = MerchantDetailsComponent.packMerchantData();
    m['sites'][SiteDetailComponent.index] = newRow;

    this.updateSiteSuccess = false;
    this.updateSiteFailed = false;
    this.updateSiteStatusSuccess = false;
    this.updateSiteStatusFailed = false;

    this.updatingMerchantSite = true;
    this.gipService.updateMerchantSite(m).subscribe(
      data => {
        let jsonResp: any = data;
        if (jsonResp.respCode == "000") {
          this.updateSiteSuccess = true;
          MerchantDetailsComponent.sites[SiteDetailComponent.index] = newRow;
        } else {
          this.updateSiteFailed = true;
          this.updatingMerchantSite = false;
        }
      },
      err => {
        this.updateSiteFailed = true;
        this.updatingMerchantSite = false;
      },
      () => {
        this.updatingMerchantSite = false;
      }
    );

    //this.activeModal.close(newRow);
  }

  updatingMerchantSiteStatus: boolean = false;
  updateSiteStatusSuccess: boolean = false;
  updateSiteStatusFailed: boolean = false;
  updateStatus() {
    this.updateSiteSuccess = false;
    this.updateSiteFailed = false;
    this.updateSiteStatusSuccess = false;
    this.updateSiteStatusFailed = false;
    let newRow = {
      "id": $('#siteid').val(),
      "location": $('#sitelocation').val(),
      "typeOfSite": $('#sitetypeofsite').val(),
      "openingDate": $('#siteopeningdate').val(),
      "country": $('#sitecountry').val(),
      "region": $('#siteregion').val(),
      "city": $('#sitecity').val(),
      "physicalAddress1": $('#sitephysicaladdress1').val(),
      "physicalAddress2": $('#sitephysicaladdress2').val(),
      "physicalAddress3": $('#sitephysicaladdress3').val(),
      "digitalAddress": $('#sitedigitaladdress').val(),
      "email": $('#siteemail').val(),
      "mobileNumber": $('#sitemobilenumber').val(),
      "acceptorPoints": SiteDetailComponent.acceptorPoints,
      "name": $('#sitename').val(),
      "status": $('#sitestatus').val()
    };

    var m: Merchant = MerchantDetailsComponent.packMerchantData();
    m['sites'][SiteDetailComponent.index] = newRow;

    this.updatingMerchantSiteStatus = true;
    this.gipService.updateMerchantSiteStatus(m).subscribe(
      data => {
        let jsonResp: any = data;
        if (jsonResp.respCode == "000") {
          this.updateSiteStatusSuccess = true;
          MerchantDetailsComponent.sites[SiteDetailComponent.index].status = newRow.status;
        } else {
          this.updateSiteStatusFailed = true;
          this.updatingMerchantSiteStatus = false;
          $('#sitestatus').val(MerchantDetailsComponent.sites[SiteDetailComponent.index].status);
        }
      },
      err => {
        this.updateSiteStatusFailed = true;
        this.updatingMerchantSiteStatus = false;
        $('#sitestatus').val(MerchantDetailsComponent.sites[SiteDetailComponent.index].status);
      },
      () => {
        this.updatingMerchantSiteStatus = false;
      }
    );

    //this.activeModal.close(newRow);
  }

  remove(index) {
    removeFromArray(SiteDetailComponent.acceptorPoints, index);
  }

  close() {
    this.updateSiteSuccess = false;
    this.updateSiteFailed = false;
    this.updateSiteStatusSuccess = false;
    this.updateSiteStatusFailed = false;
    this.activeModal.dismiss();
  }

  generateQr(index) {
    if (SiteDetailComponent.acceptorPoints[index].saved) {
      SiteDetailComponent.requestData = {
        "merchantId": $('#id').val(),
        "siteId": $('#siteid').val(),
        "acceptorPointId": SiteDetailComponent.acceptorPoints[index].id,
        "acceptorPointName": SiteDetailComponent.acceptorPoints[index].name,
        "visa": $('#visaidentifier').val(),
        "mastercard": $('#mastercardidentifier').val(),
        "unionpay": $('#upiidentifier').val()
      }
      this.modalService.open(GenerateQrModalDetails);
    }
  }
}

@Component({
  templateUrl: './update-acceptor-point.html',
  styleUrls: ['./merchant-details.component.css']
})
export class UpdateAcceptorPointDetails {

  static index: number;

  constructor(public activeModal: NgbActiveModal, private gipService: GipService) {
    console.log(this)
  }


  updatingMerchantTerminal: boolean = false;
  updateTerminalSuccess: boolean = false;
  updateTerminalFailed: boolean = false;
  save() {
    let newRow = {
      "id": $('#acceptorpointid').val(),
      "name": $('#acceptorpoint').val(),
      "acronym": $('#acceptorpointacronym').val(),
      "mobileNumber": $('#acceptorpointmobilenumber').val(),
      "saved": true
    };

    var m: Merchant = MerchantDetailsComponent.packMerchantData();
    m['sites'][SiteDetailComponent.index]['acceptorPoints'][UpdateAcceptorPointDetails.index] = newRow;

    this.updateTerminalFailed = false;
    this.updateTerminalSuccess = false;

    this.updatingMerchantTerminal = true;
    this.gipService.updateMerchantTerminal(m).subscribe(
      data => {
        let jsonResp: any = data;
        if (jsonResp.respCode == "000") {
          this.updateTerminalSuccess = true;
          MerchantDetailsComponent.sites[SiteDetailComponent.index].acceptorPoints[UpdateAcceptorPointDetails.index] = newRow;
        } else {
          this.updatingMerchantTerminal = false;
          this.updateTerminalFailed = true;
        }
      },
      err => {
        this.updatingMerchantTerminal = false;
        this.updateTerminalFailed = true;
      },
      () => {
        this.updatingMerchantTerminal = false;
      }
    );

    //this.activeModal.close(newRow);
  }

  close() {
    this.updateTerminalFailed = false;
    this.updateTerminalSuccess = false;
    this.activeModal.dismiss();
  }
}

